  // Get N/S/E/W edge values from all of the polygons that is (x,y)s.
  const ends = getEnds(奈良県高取町['polygons']);

  // Shape size on actual coordinate(before scaling)
  const shapeWidth = Math.abs(ends.w - ends.e);
